var PRINT = PRINT || {};
(function (r) {
  "use strict";
  PRINT = {
    init: function () {
      var t = felan_template_vars.ajax_url;
      r("body").on("click", "#btn-print-freelancer", function (e) {
        var a = r(this).data("freelancer-id"),
          n = window.open(
            "",
            n,
            "scrollbars=0,menubar=0,resizable=1,width=991 ,height=800"
          );
        r.ajax({
          type: "POST",
          url: t,
          data: {
            action: "felan_freelancer_print_ajax",
            freelancer_id: a,
            isRTL: r("body").hasClass("rtl") ? "true" : "false",
          },
          success: function (e) {
            n.document.write(e);
            n.document.close();
            n.focus();
          },
        });
      });
    },
  };
  r(document).ready(function () {
    PRINT.init();
  });
})(jQuery);
